const ADD_NUMBER = 'ADD_NUMBER';
const MINUS_NUMBER = 'MINUS_NUMBER';

const default_store = {
  count : 0,
  text: 'число',
}

function reducer(state=default_store, action) {
  switch(action.type) {
    case ADD_NUMBER : return {...state, count: state.count + action.payload};
    case MINUS_NUMBER: return {...state, count: state.count - action.payload};
    default: return state;
  }
}

